import React from 'react';
import Login from '../Login';
import {Container} from '../Login/loginStyle'





const LogIn = ()=>{
    console.log("Log in rendered")
    return(
        <Container>
    
            
            <Login/>


            <div>

                <fieldset>
                <form onSubmit>
                    <label> EMAIL/PHONE NUMBER<br/></label>

                    <input type='email' name='Email' placeholder='Email' required onChange/>
                    <label> PASSWORD<br/></label>
                    <input type='password' name='Password' placeholder='Password' required onChange/>
                    
                    <button onSubmit>Log in</button>

                    <p>Cant sign in, Reset password he</p>
                </form>
                </fieldset>

            </div>
            

        </Container>

       
    );
};
export default LogIn;
